import "./App.css";
import React from "react";
import bg from "./images/bg.jpg";
import bluesq from "./images/bluesq.jpeg";
import stack from "./images/stack.png";
import linkedin from "./images/linkedin.png";
import facebook from "./images/facebook.png";
import instagram from "./images/instagram.png";
import youtube from "./images/youtube.png";
import hpy from "./images/thhs.png";
import commerce from "./images/commerce.png";
import employment from "./images/employment.png";
import energy from "./images/energy.png";
import gender from "./images/gender.png";
import reading from "./images/reading.png";
import skill from "./images/skill.png";
import tree from "./images/tree.png";

function Moonproject(props) {
  return <div>#MoonProject</div>;
}

function LeftPanel(props) {
  const ls = [bluesq, stack, linkedin, facebook, instagram, youtube];

  let arr = ls.map(function (item) {
    return <img className="list-images" src={item}></img>;
  });

  return arr;
}
function Folder_data(props) {
  const ls = [
    [reading, "\tChild\n    Education"],
    [tree, "\tTree\n    Plantation"],
    [gender, "\tGender\n    Inclusivity"],
    [employment, "   Employment\n    Generation"],
    [commerce, "\tCause Driven\n    Consumerism"],
    [skill, "\tSkill\n    Training"],
    [energy, "Renewable Energy\n    Adoption"],
  ];

  let arr = ls.map(function (item) {
    return (
      <span>
        <img className="folder-images" src={item[0]}></img>
        <br />
        <span className="folder-images-text">{item[1]}</span>
      </span>
    );
  });
  return arr;
}
function App() {
  return (
    <div className="App">
      <div className="leftpane">
        <LeftPanel />
      </div>
      <div className="appbackground">
        <div className="container-main">
          <div className="moon-project">#MoonProject</div>
          <div className="happy-show">
            <img src={hpy} style={{ width: "35%", height: "35%" }}></img>
          </div>
          <div className="folder">
            <Folder_data />
          </div>
        </div>
      </div>
      <div className="sliderbackground">
        <div className="leftarrow"></div>
        <div className="mid-section"></div>
        <div className="rightarrow"></div>
      </div>
    </div>
  );
}
function Slider(props) {}
export default App;
